const CartActionTypes = {
  toggleCartDropdown: "TOGGLE_CART_DROPDOWN",
  addItem: "ADD_ITEM",
  removeItem: "REMOVE_ITEM",
  clearItemFromCart: "CLEAR_ITEM_FROM_CART"
};

export default CartActionTypes;
